import React from 'react';
import { Parallax } from 'react-parallax';
// import classes from './Parallax.module.css';

const parallax = props => {
    return(
        <Parallax
            bgImage={props.image}
            strenthen={900}
        >
            <div style={{height: "650px"}}/>
        </Parallax>
    )
}

export default parallax;
